        private void BindCountyName()
        {
            MySqlConnection con = new MySqlConnection(ConfigurationManager.ConnectionStrings["MyConnectionString"].ConnectionString);
            DataSet ds = new DataSet();
            string query = "SELECT distinct County_Name FROM state_county_master where State_Name = '" + dropState.Text + "' and address_type!='0' order by county_name asc";
            con.Open();
            MySqlCommand cmd = new MySqlCommand(query, con);
            MySqlDataAdapter da = new MySqlDataAdapter();
            da.SelectCommand = cmd;
            da.Fill(ds);
            dropCounty.DataSource = ds.Tables[0];
            dropCounty.DataTextField = "County_Name";
            dropCounty.DataBind();
            dropCounty.Items.Insert(0, "--select--");
            con.Close();
        }


        private void BindStateName()
