        private void BindStateCountyName()
        {
            DataSet ds = new DataSet();
            MySqlConnection con = new MySqlConnection(ConfigurationManager.ConnectionStrings["MyConnectionString"].ConnectionString);
            string query = "select state_name,county_name from state_county_master where address_type!='0' group by state_name,county_name";
            string space = " ";
            con.Open();
            MySqlCommand cmd = new MySqlCommand(query, con);
            MySqlDataAdapter da = new MySqlDataAdapter();
            da.SelectCommand = cmd;
            da.Fill(ds);
            ds.Tables[0].Columns.Add("StateAndCounty", typeof(string), "state_name +'" + space + "'+ county_name");
            DropDownList2.DataSource = ds.Tables[0];
            DropDownList2.DataTextField = "StateAndCounty";
            DropDownList2.DataBind();
            DropDownList2.Items.Insert(0, "County List ▼");
            DropDownList2.Items.Insert(1, "━━━━━━━━━━━━━━━━━━━━━");
            con.Close();
            string Statequery = "select state_name, count(*) as no from state_county_master where address_type!='0' group by state_name";
            con.Open();
            cmd = new MySqlCommand(Statequery, con);
            MySqlDataAdapter daSt = new MySqlDataAdapter(cmd);
            daSt.Fill(ds);
            DataSet dsSt = new DataSet();
            daSt.Fill(dsSt);
            con.Close();
            int indexCount = 2;
            if (dsSt.Tables[0].Rows.Count > 0)
            {
                for (int i = 0; i < dsSt.Tables[0].Rows.Count; i++)
                {
                    indexCount = indexCount + Convert.ToInt16(dsSt.Tables[0].Rows[i]["no"]);
                    if (i != 0)
                    {
                        indexCount = indexCount + 1;
                    }
                    DropDownList2.Items.Insert(indexCount, "━━━━━━━━━━━━━━━━━━━━━");
                }
            }


        }


