        protected void DropDownList2_SelectedIndexChanged(object sender, EventArgs e)
        {
            string str = DropDownList2.SelectedItem.Text;
            if (!str.Contains("County List ?") && !str.Contains("?????????????????????"))
            {
                string state = str.Substring(0, str.IndexOf(' '));
                string county = str.Substring(str.IndexOf(' ') + 1);
                dropState.Text = state;
                dropCounty.Items.Clear();
                dropCounty.Items.Insert(0, county);
                SelectAddressSearchType();
                if (GlobalClass.sname == "NJ" || GlobalClass.sname == "CT")
                {
                    dropTownship.Visible = true;
                    labelTown.Visible = true;
                    BindTownshipName();
                }
            }
            else
            {
                BindStateCountyName();
            }

        }


        public void SelectAddressSearchType()
        {
            string searchType = ""; GlobalClass.sname = ""; GlobalClass.cname = "";
            MySqlConnection con = new MySqlConnection(ConfigurationManager.ConnectionStrings["MyConnectionString"].ConnectionString);
            string query = "SELECT Address_Type,State_County_Id,state_name,county_name,CountyTakenTime FROM state_county_master where State_Name = '" + dropState.Text + "' and County_Name='" + dropCounty.Text + "'";
            con.Open();
            MySqlCommand cmd = new MySqlCommand(query, con);
            MySqlDataReader dr = cmd.ExecuteReader();
            while (dr.Read())
            {
                searchType = dr["Address_Type"].ToString();
                statecountyid = dr["State_County_Id"].ToString();
                GlobalClass.sname = dr["state_name"].ToString();
                GlobalClass.cname = dr["county_name"].ToString();
                HttpContext.Current.Session["CountyTakentime"] = dr["CountyTakenTime"].ToString();
            }
            dr.Close();
            con.Close();

            string Time = HttpContext.Current.Session["CountyTakentime"].ToString();
            Cotime.Value = Time;

            if (searchType == "S")
            {
                Panel1.Visible = true;
                Panel2.Visible = false;
            }
            else if (searchType == "M")
            {
                Panel1.Visible = false;
                Panel2.Visible = true;
            }
            else
            {
                Panel1.Visible = false;
                Panel2.Visible = false;
            }

        }



