        public int ExecuteSPNonQuery(string Query, bool isProcedure, MySqlParameter[] myParams)
        {
            int result;
            string constr = @"server=192.168.10.8;database=maricopa;uid=root;password=excel90();pooling=false;default command timeout=99999;";
            MySqlConnection con = new MySqlConnection(constr);
            MySqlCommand mCmd = new MySqlCommand(Query, con);
            con.Open();
            if (isProcedure)
            {
                mCmd.CommandType = System.Data.CommandType.StoredProcedure;
                if (myParams != null)
                {
                    foreach (MySqlParameter param in myParams)
                    {
                        mCmd.Parameters.Add(param);
                    }
                }
            }
            try
            {
                result = mCmd.ExecuteNonQuery();
            }
            catch (MySqlException mye)
            {
                con.Close();
                con.Dispose();
                return -1;
            }
            finally
            {
                con.Close();
                con.Dispose();
            }
            return result;
        }

        private void InsertErrorLog(string qry)
        {
            MySqlConnection con = new MySqlConnection(ConfigurationManager.ConnectionStrings["MyConnectionString"].ConnectionString);
            {
                using (MySqlCommand cmd = new MySqlCommand(qry, con))
                {
                    con.Open();
                    cmd.ExecuteNonQuery();
                    con.Close();
                }
            }
        }

